import React from "react";

export default function Navbar() {
  return(
    <header className="navbar-content">
      <div className="navbar-text">
        <h1>Serendipitous Masterpieces: Embracing the Beauty of Art Created by Accident</h1>
        <h4>Embracing the Beauty of Art Created by Accident</h4>
        <p>Welcome to "Serendipitous Masterpieces," an extraordinary website that celebrates the unexpected beauty that arises from accidental artistic creations. This captivating collection showcases a diverse range of artworks that have emerged from fortuitous accidents, offering a unique glimpse into the extraordinary creative potential that can emerge from unexpected circumstances.</p>
      </div>
    </header>
  )
}
